import React  from 'react';
import Routes from './routes';

import './css/cssStyle.css';

import Header   from './components/header';
import { AuthUserContext } from './components/Session';

const App = function() {
  return(
    <div className="App">
      <Header   />
      <AuthUserContext.Consumer> 
        <Routes   />
      </AuthUserContext.Consumer>
    </div>
  );
};

export default App;
